}
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...props} components={components} mdxType="MDXLayout">
    <pre><code {...{
        "className": "language-tsx",
        "parentName": "pre"
      }}>{`interface GooglePlacesAutocompleteProps {
  apiKey?: string;                               // default: ''
  autocompletionRequest?: AutocompletionRequest; // default: { }
  debounce?: number;                             // default: 300
  minLengthAutocomplete?: number;                // default: 0
  onLoadFailed?: (error: Error) => void;         // default: console.error
  selectProps?: SelectProps;                     // default: { }
  withSessionToken?: boolean;                    // default: false
}
`}</code></pre>
    <p>{`Where `}
      <inlineCode {...{
        "parentName": "p"
      }}>{`SelectProps`}</inlineCode>
      {` are the ones accepted by `}
      <a {...{
        "href": "https://react-select.com/props",
        "parentName": "p"
      }}>{`react-select`}</a>
      {`.`}</p>
    <h2><inlineCode {...{
        "parentName": "h2"
      }}>{`apiKey`}</inlineCode></h2>
    <p>{`If this parameter is passed, the component will inject the `}
      <a {...{
        "href": "https://developers.google.com/maps/documentation/javascript/",
        "parentName": "p"
      }}>{`Google Maps JavaScript API`}</a>
      {` usign this `}
      <inlineCode {...{
        "parentName": "p"
      }}>{`apiKey`}</inlineCode>
      {`. So there's no need to manually add the `}
      <inlineCode {...{
        "parentName": "p"
      }}>{`script`}</inlineCode>
      {` tag to yout HTML document.`}</p>
    <h2><inlineCode {...{
        "parentName": "h2"
      }}>{`autocompletionRequest`}</inlineCode></h2>
    <p>{`Autocompletion request object to add restrictions to the search. Let's see the shape this prop can take:`}</p>
    <pre><code {...{
        "className": "language-tsx",
        "parentName": "pre"
      }}>{`interface LatLng {
  lat: number;
  lng: number;
}

interface AutocompletionRequest {
  bounds?: [LatLng, LatLng];
  componentRestrictions?: { country: string | string[] };
  location?: LatLng;
  offset?: number;
  radius?: number;
  types?: string[];
}
`}</code></pre>
    <p>{`Here's an example on how to use it:`}</p>
    <pre><code {...{
        "className": "language-jsx",
        "parentName": "pre"
      }}>{`<GooglePlacesAutocomplete
  autocompletionRequest={{
    bounds: [
      { lat: 50, lng: 50 },
      { lat: 100, lng: 100 }
    ],
    componentRestrictions: {
    country: ['us', 'ca', 'uy'],
    }
  }}
/>
`}</code></pre>
    <p><strong {...{
        "parentName": "p"
      }}>{`Note:`}</strong>
      {` for more information check `}
      <a {...{
        "href": "https://developers.google.com/maps/documentation/javascript/reference/places-autocomplete-service#AutocompletionRequest",
        "parentName": "p"
      }}>{`google documentation`}</a>
      {`.`}</p>
    <h2><inlineCode {...{
        "parentName": "h2"
      }}>{`debounce`}</inlineCode></h2>
    <p>{`The number of milliseconds to delay before making a call to Google Maps API.`}</p>
    <h2><inlineCode {...{
        "parentName": "h2"
      }}>{`minLengthAutocomplete`}</inlineCode></h2>
    <p>{`Defines a minimum number of characters needed on the input in order to make requests to the Google's API.`}</p>
    <h2><inlineCode {...{
        "parentName": "h2"
      }}>{`onLoadFailed`}</inlineCode></h2>
    <p>{`Function to be called when the injection of the `}
      <a {...{
        "href": "https://developers.google.com/maps/documentation/javascript/",
        "parentName": "p"
      }}>{`Google Maps JavaScript API`}</a>
      {` fails due to network error.`}</p>
    <p>{`For example:`}</p>
    <pre><code {...{
        "className": "language-jsx",
        "parentName": "pre"
      }}>{`<GooglePlacesAutocomplete
  onLoadFailed={(error) => (
    console.error("Could not inject Google script", error)
  )}
/>
`}</code></pre>
    <h2><inlineCode {...{
        "parentName": "h2"
      }}>{`selectProps`}</inlineCode></h2>
    <p>{`As this component uses `}
      <a {...{
        "href": "https://react-select.com",
        "parentName": "p"
      }}>{`react-select`}</a>
      {` under the hood, this prop accepts everything that's accepted by it. You can check `}
      <a {...{
        "href": "https://react-select.com/props",
        "parentName": "p"
      }}>{`react-select props here`}</a>
      {`.`}</p>
    <p>{`For example, a really common use would be to use it as a controlled input:`}</p>
    <pre><code {...{
        "className": "language-jsx",
        "parentName": "pre"
      }}>{`const [value, setValue] = useState(null);

<GooglePlacesAutocomplete
  selectProps={{
    value,
    onChange: setValue,
  }}
/>
`}</code></pre>
    <h2><inlineCode {...{
        "parentName": "h2"
      }}>{`withSessionToken`}</inlineCode></h2>
    <p>{`If this prop is set to `}
      <inlineCode {...{
        "parentName": "p"
      }}>{`true`}</inlineCode>
      {`, the component will handle changing the `}
      <inlineCode {...{
        "parentName": "p"
      }}>{`sessionToken`}</inlineCode>
      {` on every session. To learn more about how this works refer to `}
      <a {...{
        "href": "https://developers.google.com/places/web-service/session-tokens",
        "parentName": "p"
      }}>{`Google Places Session Token docs`}</a>
      {`.`}</p>

  </MDXLayout>;
}

